:text: |
  Descendants of WILLIAMS, William and NELSON, Jane
  JWILLIAMS, William Leonard and WANKLYN, Sarah
  WILLIAMS, Margaret Ellen and MACLEAN, Christopher Haydon
  IMACLEAN, Kenneth Edward and PALMER, Beatrice Daisy
  IMACLEAN, John Raglan and TURNER, Beatrice Maitland
  MACLEAN, John Raglan and TURNER, Beatrice Maitland (cont...)
  member of the Henry and William Williams Memorial Trust (Inc) since 1977. He was a foundation member
  of Birthright in Hastings, Whakatane and Gisborne, and of Arohanui in Auckland.
  Beatrice, known as Betty, was an only child. She was educated in England at an Anglo-Catholic Convent
  and then at Headington School, Oxford. She joined the WRNS in 1944 then trained as a radiographer at
  Middlesex Hospital, London in 1947-49. She worked in London until emigrating to New Zealand in 1954
  then worked at Auckland Hospital until her marriage in 1955. She married again to RJ M Coates on
  18.08.1973.
  01> MACLEAN, Fiona Mary m on 07.05.1988 to CRONIN, Michael George
  b 24.07.1956
  b 08.08.1946
  Fiona b. at Hastings and m. at Auckland. Michael, s/o Arthur George Cronin and Joy Frances Barnett,
  b. at Takaka, Nelson. Address: 269a Mount Albert Road (PO Box 16-184), Sandringham, Auckland 3.
  Fiona was educated at the Diocesan School for Girls, Auckland and the Auckland Technical Institute
  where she did a one-year secretarial course in 1974. Her first secretarial position was at the
  University of Auckland where she was encouraged to enrol for part-time study. She initially
  studied towards a BA but switched to a BCom which she completed in 1991. The following year she
  completed a Diploma of Commerce. Between 1975 and 1991 Fiona worked at the University of Auckland
  in increasingly senior administrative positions, taking time out only for an 18-month trip
  overseas. In 1993 she began working as an accountant and, having completed all the requirements,
  qualified as a Chartered Accountant in 1996.
  Michael was educated at Nelson, Christchurch Teachers' College and the University of Auckland,
  graduating BA in 1990. He taught at primary and intermediate schools (1966-79) before joining the
  administrative staff at the University of Auckland. He has been the Group Manager for Admissions
  and Enrolment since 1995. Michael has three children, Gareth (b. 1975), Bridgette (b. 1977) and
  Julian (b. 1983).
  02> MACLEAN, Benjamin John
  b 10.09.1957
  Benjamin b. at Hastings. He is severely mentally retarded. He was admitted to Kingseat Hospital in
  1959 and moved from there to Mangere Hospital in 1966. With the health sector reforms that
  resulted in Mangere Hospital being de-gazetted and patients moved to community houses, Ben moved to
  Gilead Farm, Helensville in 1993.
  Gilead Farm is run by the Spectrum Care Trust Board which contracts with the Regional Health
  Authority to provide long-term residential care for people with intellectual disabilities. Clients
  are carefully placed in community houses and are cared for by local residents trained to look after
  them on a rostered basis, 24 hours a day.
  Ben is with about five or six others in a house set on about two acres. He enjoys the space, both
  in the house and its environs. He will stay at Gilead Farm as long as it suits him. He enjoys the
  one-to-one attention that is available and has thrived in the de-institutionalised environment.
  For years family members have been visiting Ben frequently and taking him for walks and drives, for
  both of which he shows eagerness. He has no speech but has some understanding and responds, if he
  so chooses, to suggestions as to what he might do. He can also make his needs known, for example,
  when he wants a cup of tea.
  Ben is an epileptic and has seizures, but otherwise requires no special medical treatment.
  03> MACLEAN, Hugh William
  b 16.03.1960
  Hugh b. at Wellington. He is the 3rd child of the 3rd child of the 3rd child of the 3rd child of
  the 3rd child of Bishop William Williams. Address: 2 Riverina Avenue, Pakuranga, Auckland.
  Hugh was educated at Takapuna Grammar School then joined the Bank of New South Wales (now Westpac
  Trust) at Birkenhead in 1977. Several branches and promotions later, he is now a Manager of the
  Property Finance Division of the Auckland Head Office.
  Hugh enjoys sport, both actively and passively, participating in social sporting activities, and
